const INITIAL_STATE = {
    product: 'ok redux',
    products: []
}

function reducer(state=INITIAL_STATE, action) {
    switch (action.type) {
        case "GET_PRODUCTS":
            return 23;            

        default:
            return state;
    }
}

export default reducer;

